INSERT INTO `lugar` (`id_lugar`, `nombre`, `direccion`, `descripcion`, `imagen`) VALUES
(1, 'Parque Ecológico Canoas', 'Vía Soacha - Mondoñedo, Soacha, Cundinamarca.', 'Este parque, parte del programa Hojas Verdes, se dedica a la restauración ecológica de áreas degradadas. Con aproximadamente 140 hectáreas, alberga una gran diversidad de especies del Bosque Alto Andino. Ofrece senderos para caminatas, observación de aves y ciclismo de montaña, proporcionando un refugio natural ideal para los amantes de la naturaleza.', );
INSERT INTO `lugar` (`id_lugar`, `nombre`, `direccion`, `descripcion`, `imagen`) VALUES
(2, 'Plaza Principal de Soacha', 'Carrera 30 # 30-10, Soacha, Cundinamarca.', 'La Plaza Principal de Soacha es el corazón histórico y cultural de la ciudad. Este lugar vibrante está rodeado de edificios emblemáticos, jardines bien cuidados y ofrece un espacio ideal para reuniones comunitarias y eventos culturales. La plaza es un punto de encuentro para residentes y visitantes, y a menudo alberga ferias, conciertos y celebraciones. Es el lugar perfecto para pasear, disfrutar de la arquitectura local y sumergirse en la vida cotidiana de Soacha.', );
INSERT INTO `lugar` (`id_lugar`, `nombre`, `direccion`, `descripcion`, `imagen`) VALUES
(3, 'Salto del Tequendama', 'Km 13 de la Autopista Bogotá-Girardot, Soacha, Cundinamarca.', 'El Salto del Tequendama es una de las maravillas naturales más impresionantes de Colombia. Esta cascada tiene una caída de aproximadamente 132 metros y ofrece vistas espectaculares que dejan sin aliento a los visitantes. El área circundante es rica en flora y fauna, y cuenta con un mirador cercano que permite admirar la belleza del paisaje. Este lugar no solo es un destino popular para los amantes de la naturaleza y la aventura, sino también un sitio de gran importancia histórica y cultural.', );
INSERT INTO `lugar` (`id_lugar`, `nombre`, `direccion`, `descripcion`, `imagen`) VALUES
(4, 'Casa Museo Salto del Tequendama', 'Km 13 de la Autopista Bogotá-Girardot, Soacha, Cundinamarca.', 'La Casa Museo Salto del Tequendama es una antigua mansión que se ha convertido en un museo dedicado a la historia y ecología de la región. Esta casa ofrece exposiciones permanentes sobre la biodiversidad local, la historia del Salto del Tequendama y la importancia del área en la cultura colombiana. Los visitantes pueden explorar la casa, disfrutar de las exhibiciones interactivas y aprender sobre los esfuerzos de conservación en curso para proteger esta área natural.', );
INSERT INTO `lugar` (`id_lugar`, `nombre`, `direccion`, `descripcion`, `imagen`) VALUES
(5, 'Humedal Neuta', 'Vereda Neuta, Soacha, Cundinamarca.', 'El Humedal Neuta es un área protegida que sirve como hábitat para una gran diversidad de aves y otras especies de fauna local. Este humedal es un lugar ideal para los amantes de la naturaleza y los observadores de aves, ya que ofrece un entorno tranquilo y sereno donde se puede disfrutar de la belleza natural. Los senderos del humedal permiten a los visitantes explorar y apreciar la riqueza ecológica de la zona.', );
INSERT INTO `lugar` (`id_lugar`, `nombre`, `direccion`, `descripcion`, `imagen`) VALUES
(6, 'Cerro El Cable', 'Vereda El Cable, Soacha, Cundinamarca.', 'El Cerro El Cable es un lugar destacado para el senderismo y la observación de la naturaleza en Soacha. Ofrece vistas panorámicas impresionantes de la ciudad y sus alrededores. Es un destino popular para los excursionistas y los amantes de la aventura, quienes pueden disfrutar de la flora y fauna locales mientras suben por sus senderos. Este cerro es conocido por su tranquilidad y las oportunidades de avistamiento de aves.', );
INSERT INTO `lugar` (`id_lugar`, `nombre`, `direccion`, `descripcion`, `imagen`) VALUES
(7, 'Parque La Arenosa', 'Vereda La Arenosa, Soacha, Cundinamarca.', 'Este parque natural es ideal para actividades recreativas y al aire libre. Ofrece amplias zonas verdes para picnic, senderos para caminatas y espacios para el esparcimiento. Los visitantes pueden disfrutar de un día relajante en la naturaleza, rodeados de la flora y fauna local. El Parque La Arenosa es un lugar perfecto para familias y grupos que buscan un escape tranquilo del bullicio de la ciudad.', );
INSERT INTO `lugar` (`id_lugar`, `nombre`, `direccion`, `descripcion`, `imagen`) VALUES
(8, 'Boquemonte Reserva Natural', 'Vereda El Charquito, Soacha, Cundinamarca.', 'Una reserva natural que proporciona una experiencia inmersiva en la naturaleza. Boquemonte es ideal para caminatas guiadas, observación de flora y fauna, y la tranquilidad de un entorno preservado. Los visitantes pueden explorar senderos que serpentean a través de diversos ecosistemas, ofreciendo una vista de la rica biodiversidad de la región. Además, la reserva cuenta con programas educativos y de conservación que promueven la importancia de proteger el medio ambiente. Las actividades incluyen talleres sobre la flora y fauna local, así como sesiones de fotografía de naturaleza. Es un lugar perfecto para quienes buscan una conexión profunda con la naturaleza y desean aprender sobre la conservación del medio ambiente. La tranquilidad y la belleza de Boquemonte hacen de este lugar un refugio ideal para los amantes de la naturaleza.', );
INSERT INTO `lugar` (`id_lugar`, `nombre`, `direccion`, `descripcion`, `imagen`) VALUES
(9, 'Casa de la Cultura', 'Carrera 7 # 15-71, Soacha, Cundinamarca.', 'La Casa de la Cultura de Soacha es un vibrante centro cultural dedicado a promover el desarrollo artístico de la comunidad. Ofrece programas y actividades en diversas disciplinas artísticas, como danza, música, teatro, artes plásticas, audiovisuales, narración oral y lectura, a través de sus Escuelas de Formación Artística. También organiza exposiciones de arte, muestras gastronómicas y artesanales, y eventos culturales que celebran la diversidad cultural de Soacha. Cuenta con una biblioteca que proporciona una vasta colección de libros, revistas y recursos educativos, ideal para los amantes de la lectura. Además, dispone de una ludoteca para actividades recreativas infantiles y organiza actividades recreativas durante las vacaciones escolares para niños y jóvenes. A través de encuentros culturales y talleres, incentiva la cultura a través de diferentes expresiones artísticas, promoviendo la identidad cultural de la comunidad. Es un lugar vibrante y dinámico que busca conectar a la comunidad a través del arte y la cultura, y revitalizar el interés por las artes en la región.', );

